import React from 'react'

export default function FooterTextArea() {
    return (
        <form name="message" className="chat--footer-textarea">
            <textarea name="text" className="message-text" rows="3" placeholder="Write a message..."></textarea>
            <input type="button" id="button-send" value="Send"/>
        </form>
    )
}
